import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import MainPage from "./MainPage";
import Navbar from "./Navbar";
import StudentList from './StudentList'
import Certificate from "./Certificate";

function App() {
  const data = {year:null, branch:null, heldin:null}
  const resultData = null
  return(
    <React.Fragment>
      <Navbar/>
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<MainPage onSucc={data}/>} />
        <Route path='/results' element={<StudentList data={data} getdata={resultData} />} />
        <Route path='/results/certificate' element={<Certificate setresultData={resultData} />} />
       </Routes>


    </BrowserRouter>
    </React.Fragment>
  );
}

export default App;
